import React from 'react'
import NotesItem from './NotesItem'
function Notes(props) {
  const notes = props.notes
  return (
    <>
      <div className="row">
        <div className="col">
          {
            notes.map((note) => {
              return <NotesItem note={note} />
            })
          }
        </div>
      </div>
    </>
  )
}

export default Notes
